import FormLayout from '../../components/form-layout';
import { H2 } from './styles';

const Login = () => {
    return (
        <>
            <H2>
                QUE TAL MOSTRAR QUE VOCÊ É O <strong>MELHOR?</strong>
            </H2>
            <FormLayout />
        </>
    );
};

export default Login;
